> I see no mention of a chassis-fan association in the docs you linked.  Maybe I missed it?

Oh, This is the path of the fan sensor. For all sensor paths, we have associated an all_sensors, and its rType is chassis.

eg: fanSensorPath=/xyz/openbmc_project/sensors/fan_tach/fan0_0
```
busctl get-property  xyz.openbmc_project.ObjectMapper /xyz/openbmc_project/sensors/fan_tach/fan0_0/chassis xyz.openbmc_project.Association endpoints --verbose
ARRAY "s" {
        STRING "/xyz/openbmc_project/inventory/system/chassis";
};

```

